webpackJsonp([81364085681028],{1320:function(e,t){e.exports={data:{package:{type:"published",id:"reason-expo",name:"reason-expo",version:"33.1.0",category:"binding",flags:[],platforms:["node"],description:"ReasonML bindings for Expo",keywords:["react","platform api","react-native"],license:"MIT",updated:"2019-06-07T23:24:00.358Z",stars:71,score:.5630553261466447,quality:.6075536052188183,popularity:.08797857256241495,maintenance:.9999906976690114,readme:'<p align="center">\n  <img alt="Reason Expo Logo" src="./reason-expo.png" width="256">\n</p>\n<h3 align="center" style="font-weight:600">\n  reason-expo\n</h3>\n<p align="center">\n  <a href="https://reasonml.github.io/">ReasonML</a> bindings for <a href="https://expo.io">Expo</a>\n</p>\n<hr>\n<div align="center">\n<p><a href="https://www.npmjs.com/package/reason-expo"><img src="https://img.shields.io/npm/v/reason-expo.svg" alt="NPM version badge"></a></p>\n</div>\n<h2 id="getting-started"><a href="#getting-started" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Getting started</h2>\n<p>Use the Expo CLI to bootstrap a project with the ReasonExpo template.</p>\n<div class="redex-codeblock"><pre class="hljs lang-none"><code>expo <span class="hljs-keyword">init</span> &lt;<span class="hljs-type">PROJECT_NAME</span>&gt; --template expo-template-reason</code></pre></div>\n<p>Already have an existing Expo Project?</p>\n<p>Follow <a href="https://medium.com/@peterpme/your-first-reasonml-pr-into-an-existing-react-native-codebase-a490b4a79649">this guide</a> by <a href="https://twitter.com/peterpme">Peter Piekarczyk</a> on getting ReasonML set up in an existing React Native app.</p>\n<p>Once completed, <code>yarn add reason-expo</code>, and add <code>"reason-expo"</code> to your <code>bs-dependencies</code> array in <code>bsconfig.json</code>. Now get coding!</p>\n<h2 id="contributing"><a href="#contributing" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Contributing</h2>\n<p>Fork this repo, clone it onto your machine, install dev dependencies with <code>yarn install::dev</code>, start the compiler with <code>yarn start</code>, and start hacking away!</p>\n<p><em>Credit: This project is based on the work started in <a href="https://github.com/fxfactorial/bs-expo/"><code>bs-expo</code></a>.</em></p>\n',homepageUrl:"https://github.com/fiberjw/reason-expo.git",repositoryUrl:"https://github.com/fiberjw/reason-expo",npmUrl:"https://www.npmjs.com/package/reason-expo",issuesUrl:"https://github.com/fiberjw/reason-expo/issues",slug:"/package/reason-expo"}},pathContext:{id:"reason-expo"}}}});
